import React from "react";
import styles from "./Xiaomi.module.css"
import ProductContainer from "../Product/ProductContainer";

const Xiaomi = ({Search,xiaomi}) => {

    if(Search!==""){
        let XiaomiElementSearch = xiaomi.filter(f=>f.name.toLowerCase().includes(Search)).map(ae=><ProductContainer key={ae.id} {...ae}/>)
        return<div className={styles.xiaomi}>

            {XiaomiElementSearch}
        </div>
    } else if (Search === "") {

    let XiaomiElements = xiaomi.map(ae=><ProductContainer key={ae.id} {...ae}/>)

    return<div className={styles.xiaomi}>
        Xiaomi
        <div>
            {XiaomiElements}
        </div>
    </div>
}}
export default Xiaomi;
